import React, { Component } from 'react';

const GameMap = (props) => {
  const flattenMap = [].concat(...props.map);
  const renderMap = flattenMap.map(cell => {
    let cellContent = "";
    if(cell.winnie) {cellContent.concat(' ', 'Winnie')};
    if(cell.wonton) {cellContent.concat(cellContent, 'Wonton')};
    if(cell.tracked) {String.concat(cellContent, 'Paw')};
    return `<div className="gameCell"> ${cellContent}</div>`
  })


  return (
    <div className="gameBoard">
      {renderMap}
    </div>
  )
}

export default GameMap;
